function onInit() {
    vm.pages = [];

    $timeout(function() {
        for (var i = 0; i < Math.ceil(vm.articlesCount / ELEMENTS_ON_PAGE); ++i) {
            vm.pages.push({
                startIndex: i * ELEMENTS_ON_PAGE,
                endIndex: i * ELEMENTS_ON_PAGE + ELEMENTS_ON_PAGE
            });
        }

        vm.setPage(0);
    }, 0);
}
